import './App.css';
import CoinCard from './CoinCard'
import CoinData from './MOCK_DATA.json';

function App() {
  return (
    <div className="App">
        ...search youir coin...
      <br /><br />
      {
        CoinData.map( (coin) => (
          <CoinCard coin = { coin } />
        )
        )
      }
    </div>
  );
}

export default App;
